    <div className={styles.searchDiv}>
       <form >
          <input
         className={styles.searchInput}
         type = "text"
         name="searchInput"
         id="searchInput"
         value={searchInput}
         onChange={handleChangeInput}
          />
          <button className={styles.searchButton}>SEARCH</button>
       </form>
    </div>    
     
    );
}

export default SearchBar;
